function HtmlElement(){this.click=function(){console.log("clicked")}}function HtmlSelectElement(items=[]){this.items=items,this.addItem=function(value){this.items.push(value)},this.removeItem=function(value){this.items.splice(this.items.indexOf(value),1)},this.render=function(){let output="<select>\n";for(item of items)output+="\t<option>"+item+"</option>\n";return output+="</select>",output}}function HtmlImageElement(src){this.src=src,this.render=function(){return'<img src="'+src+'" />'}}HtmlElement.prototype.focus=function(){console.log("focused")},HtmlSelectElement.prototype=new HtmlElement,HtmlImageElement.prototype=new HtmlElement;const e=new HtmlElement,s=new HtmlSelectElement([1,2,3]),i1=new HtmlImageElement("https://"),elements=[new HtmlSelectElement([1,2,3]),new HtmlImageElement("https://")];for(element of elements)console.log(element.render());